import React from 'react';
import Map from './Map';  // Asegúrate de que Map.js esté en el mismo directorio
import SendGps from './SendGps';  // Asegúrate de que SendGps.js esté en el mismo directorio

const App = () => {
  return (
    <div>
      <h1>GPS Tracker</h1>
      <SendGps />  {/* Formulario para enviar coordenadas GPS */}
      <Map />  {/* Mapa que muestra los puntos GPS */}
    </div>
  );
};

export default App;
